DROP TABLE IF EXISTS `fish_betround`;
CREATE TABLE `fish_betround` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `betTimeLeft` int(11) DEFAULT '0' COMMENT '下注剩余时间',
  `createTime` timestamp NULL DEFAULT NULL,
  `gameTimeLeft` int(11) DEFAULT NULL COMMENT '游戏剩余时间',
  `state` int(2) DEFAULT NULL COMMENT '当前阶段，0，下注，1，正在钓鱼，2，已经结束',
  `betTimeTotal` int(11) DEFAULT NULL COMMENT '下注总时间',
  `gameTimeTotal` int(11) DEFAULT NULL COMMENT '钓鱼总时间',
  `betLeftWinValue` int(11) DEFAULT '0' COMMENT '买左边赢的数量',
  `betRigtWinValue` int(11) DEFAULT '0' COMMENT '买右边赢的数量',
  `betPeaceValue` int(11) DEFAULT '0' COMMENT '买中间赢的数量',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8;

